import { style_mapping } from "../styled";

const {
    shared: { ListItemContainer }
} = style_mapping;

class ListItem extends Component {
  render() {
    return (
      <ListItemContainer>
        <FontAwesomeIcon icon={props.icon} />
      </ListItemContainer>
    )
  }
}

export default ListItem
